import React from 'react';
import Header from './components/Header/Header';
import {Router,Link,Route,Switch} from 'react-router-dom';
function App() {
  return (
    <Router>
      <div className="App ">
        <Header>NAVBAR</Header>
        <Switch>

        <Route path='/'>
         HOME PAGE 
        </Route>

        <Route path='/'>
          PRODUCT PAGE 
        </Route>

        <Route path='/company'>
          COMPANY PAGe
        </Route>
        </Switch>
    </div>
    </Router>
  );
}

export default App;
